import React, {useState, useEffect} from 'react';
import './Header.css'
import Box from '@mui/material/Box';
import Tab from '@mui/material/Tab';
import TabContext from '@mui/lab/TabContext';
import TabList from '@mui/lab/TabList';
import TabPanel from '@mui/lab/TabPanel';
import { withStyles } from '@mui/styles';


import DigitalCreations from './DigitalCreations';
import EventPlanning from './EventPlanning';
import Photography from './Photography';
import WritingSample from './WritingSample'

const Header = () => { 
    const [value, setValue] = React.useState('1');

    const handleChange = (event, newValue) => {
      setValue(newValue);
    };

    const CustomTab = withStyles({
        root: {
          backgroundColor: 'transparent',
          color: '#71CECE'
        },
        selected: {
        //   backgroundColor: 'transparent',
        //   color: '#71CECE'
        },
      })(Tab);

    return (
    <div>
        <div className="header">
            <h1>
            Meghan Levinson
            </h1>
            <div className="subHeader">
                Digital Marketer & Content Creator 
            </div>
        </div>
        <div className="tab">
        <Box sx={{ width: '100%' }} >
        <TabContext value={value} >
            <TabList onChange={handleChange} aria-label="lab API tabs example">
                <CustomTab label="Writing Sample" value="1"  indicatorColor="#71CECE" />
                <CustomTab label="Event Planning" value="2"  />
                <CustomTab label="Digital Creations" value="3"  />
                <CustomTab label="Photography" value="4" />
            </TabList>
        </TabContext>
        </Box>
        </div>
    </div>
)
}
export default Header
